int ftt_test(void)
{
	int i,j;
	int mLen = 128, nLen = 128;
	bool flag = 0;
	RK_complex_INT *A_In;

	//
	int M = nexttopow2(mLen);   //init_mLen2init_mLen2M
	int N = nexttopow2(nLen);

	mLen = Pow2_table[M];         //
	nLen = Pow2_table[N];         

	A_In = (RK_complex_INT *)malloc(sizeof(RK_complex_INT)*nLen*mLen);

	for(i=0; i<mLen; i++)
	{
		for(j=0; j<nLen; j++)
		{
			uchar tmp = image[i*128+j];
			
			A_In[i*nLen+j].real = (int)(tmp << Q_INPUT);
			A_In[i*nLen+j].image = 0;
		}
	}

	//FFT
	fft_2D_fixed_point(mLen,nLen,M,N,A_In,0);
	fft_2D_fixed_point(mLen,nLen,M,N,A_In,1);

	//
	for(i=0; i<mLen; i++)
	{
		for(j=0; j<nLen; j++)
		{
			int tmp = A_In[i*nLen+j].real;
			if (tmp != result[i*128+j])
			{
				flag = 1;
			}
		}
	}
	
	free(A_In);A_In = NULL;
	if (!flag)
	{
		//printf("correct!\n");
		return 0;
	}
	else
	{
		//printf("wrong!\n");
		
		return -1;
	}
	;
}
